data.render:
function render(data, options){
        // 电签图片单位
        var signImgUnit = options.state.signImgUnit ? options.state.signImgUnit : "px";
        // 电签图片宽度
        var signImgWidth = options.state.signImgWidth ? options.state.signImgWidth : None;
        // 电签图片高度
        var signImgHeight = options.state.signImgHeight ? options.state.signImgHeight : 45;
        if(!data||!data.syncdata||data.syncdata.length===0){
          return None;
        }
        var result=[];
        for(var i=data.syncdata.length-1;i>-1;i--){
          var sync=data.syncdata[i];
          if(sync.img){
            result.push("<img src='"+sync.img+"' ");
            if(signImgWidth){
              result.push(" width='"+signImgWidth+signImgUnit+"' ");
            }
            if(signImgHeight){
              result.push(" height='"+signImgHeight+signImgUnit+"' ");
            }
            result.push(" />")
          }else{
            result.push(sync.userName);
          }
        }
        return result.join('/');
      }
